import React, { useContext } from 'react';
import { observer } from 'mobx-react'
import { Context } from '..';
import { Navbar, Container, Nav, Button } from 'react-bootstrap'
import { AUTH_ROUTE } from '../utils/constants';

const NavigationMenu = observer(() => {
    const { user } = useContext(Context);
    return (
        <div>
            <Navbar bg="light" variant="light" fixed="top">
                <Container>
                    <Navbar.Brand href="/">b2b portal</Navbar.Brand>
                    <Nav >
                        <Button variant="secondary" onClick={() => user.setIsAuth(!user.getIsAuth())}>{user.getIsAuth() ? "Выйти" : "Войти"}</Button>
                    </Nav>
                </Container>
            </Navbar>
        </div>
    );
});

export default NavigationMenu;
